var title_f27_40_28291="Southern blot hybridization";
var content_f27_40_28291=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PC%2F78900&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PC%2F78900&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 523px\">",
"   <div class=\"ttl\">",
"    Southern blotting",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 503px; height: 599px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    This representation shows the steps in Southern blotting.",
"    <br/>",
"    Step 1: Genomic DNA is digested by a restriction enzyme.",
"    <br/>",
"    Step 2: DNA is run on an agarose&nbsp;gel, giving a smeared appearance.",
"    <br/>",
"    Step 3: DNA is transferred from the gel to a membrane.",
"    <br/>",
"    Step 4: A radioactive probe is hybridized to the membrane and the membrane is exposed to X-ray film. The bands show the places where the probe hybridized to the patient DNA. If the DNA has a gene deletion or a mutation that eliminates a restriction enzyme site, then one or more bands may be missing. This step can also be performed using a non-radioactive probe.",
"    <br/>",
"    In the final image, normal individuals (Lanes 2 to 4) show the expected pattern, while an individual with a partial gene deletion (Lane 5) is missing one of the bands.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
