"    <a class=\"contributor contributor_credentials\" href=\"UTD.htm?27/40/28295/contributors\">",
"     Thomas A Golper, MD",
"    </a>",
"    <br/>",
"   </div>",
"   <div>",
"    <a class=\"contributor contributor_credentials contributorType\" href=\"UTD.htm?27/40/28295/contributors\">",
"     Section Editor",
"    </a>",
"    <br/>",
"    <a class=\"contributor contributor_credentials\" href=\"UTD.htm?27/40/28295/contributors\">",
"     Steve J Schwab, MD",
"    </a>",
"    <br/>",
"   </div>",
