" <div id=\"topicContent\">",
"  <div id=\"topicTitle\">",
"   Pharmacology of antimicrobial agents for treatment of methicillin-resistant Staphylococcus aureus and vancomycin resistant enterococcus",
"  </div>",
"  <div id=\"topicContributors\">",
"   <div>",
"    <a id=\"authors\">",
"    </a>",
"    <a class=\"contributor contributor_credentials contributorType\" href=\"UTD.htm?27/40/28298/contributors\">",
"     Authors",
"    </a>",
"    <br/>",
"    <a class=\"contributor contributor_credentials\" href=\"UTD.htm?27/40/28298/contributors\">",
"     Luke F Chen, MBBS, MPH, CIC, FRACP",
"    </a>",
"    <br/>",
"    <a class=\"contributor contributor_credentials\" href=\"UTD.htm?27/40/28298/contributors\">",
"     Richard H Drew, PharmD, MS, BCPS, FCCP",
"    </a>",
"    <br/>",
"   </div>",
"   <div>",
"    <a class=\"contributor contributor_credentials contributorType\" href=\"UTD.htm?27/40/28298/contributors\">",
"     Section Editor",
"    </a>",
"    <br/>",
"    <a class=\"contributor contributor_credentials\" href=\"UTD.htm?27/40/28298/contributors\">",
"     David C Hooper, MD",
"    </a>",
"    <br/>",
"   </div>",
"   <div>",
"    <a class=\"contributor contributor_credentials contributorType\" href=\"UTD.htm?27/40/28298/contributors\">",
"     Deputy Editor",
"    </a>",
